import Header from './Header';
import Nav from './Nav'
import Main from './Main'
import Footer from './Footer'

function App() {
  return (
    <>
      <Header>
        <Nav></Nav>
      </Header>
      <Main></Main>
      <Footer></Footer>
    </>
  );
}

export default App;
